(()=>{return(n,e)=>{new SpinQuery(()=>$(".head-content.bili-wrapper>div.search:not(.filter-item)"),n=>n.length>0&&$(".nav-con.fr").filter((n,e)=>e.innerText).length>0,n=>{const e=$(".nav-con.fr").filter((n,e)=>e.innerText);n.detach().insertAfter(e)}).start();if(n.preserveRank){SpinQuery.any(()=>$(".head-content.bili-wrapper>div.search:not(.filter-item) .searchform,.nav-con #nav_searchform"),n=>{n.addClass("preserve-rank");n.prepend(`\n                        <a  title="排行榜"\n                            class="icons-enabled"\n                            href="https://www.bilibili.com/ranking"\n                            target="_blank">\n                            <i class="icon-rank"></i>\n                        </a>\n                    `)})}}})();